import React from "react";
import { Image, TouchableHighlight } from "react-native";

const BtnVerMas = () => {
  return (
    <TouchableHighlight>
      <Image
        source={require("../../../src/Assets/Images/ImageBtnVerMas.png")}
      />
    </TouchableHighlight>
  );
};

export default BtnVerMas;
